import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { AuthProvider } from "../context/auth.provider";
import { RouterPerson } from "../../person/module/person.routes";
import { RouterLogin } from "../../login/module/login.routes";
import { ProtectedRoutes } from "./Protected.routes";
import { RouterEmployee } from "../../employee/module/employee.routes";
import { NotFoundHtml } from "../errors/NotFound";
export const RoutesHtml = () => {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route element={<RouterLogin />} />
          <Route
            path="/module/*"
            element={
              <ProtectedRoutes>
                <RouterPerson />
                <RouterEmployee />
              </ProtectedRoutes>
            }
          />
          <Route path="/*" element={<NotFoundHtml />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
};
